import { BizCaptchaButton } from 'antd-more';
import { sleep } from 'ut2';

// \u63A5\u53E3\u8BF7\u6C42
async function getValidateCode() {
  await sleep();
  return;
}

export default () => {
  const [start, setStart] = useState(false);
  const [loading, setLoading] = useState(false);

  const handleClick = () => {
    setLoading(true);
    getValidateCode().then(() => {
      setLoading(false);
      setStart(true);
    });
  };

  return (
    <BizCaptchaButton
      start={start}
      second={10}
      onClick={handleClick}
      initText="\u70B9\u51FB\u5F00\u59CB\u5012\u8BA1\u65F6"
      runText="\u5269\u4F59%s\u79D2"
      resetText="\u91CD\u65B0\u5F00\u59CB"
      onEnd={() => {
        setStart(false);
      }}
      loading={loading}
    />
  );
};
